import Head from "next/head";
import Link from "next/link";
import { useEffect } from "react";
import axios from "axios";
import cheerio from "cheerio";

const loginHeader = () => {
    useEffect(() => {
        async function getHTML() {
            try {
                return await axios.get("https://maple.gg");
            } catch (error) {
                console.error(error);
            }
        }

        getHTML()
            .then((html) => {
                
                const $ = cheerio.load(html.data);
                
                const bodyList = $("ul.list--posts").children("li.item--post");

                // bodyList를 순회하며 titleList에 h2 > a의 내용을 저장
                bodyList.each(function (i, elem) {
                    titleList[i] = {
                        title: $(this).find("h2 a").text(),
                    };
                });
                return titleList;
            })
            .then((res) => console.log(res)); // 저장된 결과를 출력
    });

    return (
        <header className="d-flex justify-content-center align-items-center fs-2 text-white">
            <Head>
                <title>msg.gg</title>
                <link rel="stylesheet" href="/style/form.css" />
                <link
                    href="https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700&display=swap"
                    rel="stylesheet"
                ></link>
                <script src="/js/app.js"></script>
            </Head>
            <div className="logo fs-3 font-lighter">
                <a href="#">msg.gg</a>
            </div>
        </header>
    );
};

export default loginHeader;
